import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import RealTime from "./components/RealTime";
function App() {
  return (
    <BrowserRouter>
      <div>
        <Switch>
          <Route path="/" component={RealTime} />
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
